require_relative 'helper'
# require 'stackprof'

module Suspension

  describe AbsoluteSuspendedTokens do

    def tokens(flat)
      AbsoluteSuspendedTokens.from_flat(flat).validate
    end

    def longseq
      tokens([0,"a", 5,"bbb", 5,"ccc", 5,"ddd"])
    end

    describe "adjust_for_diff" do
      it "adjusts for deletions and insertions" do
        tokens([1,'@', 5,'%']).adjust_for_diff([[-1,'a'], [0,'bb'], [1,'cc']]) \
                              .validate.to_flat \
                              .must_equal [0,'@',6,"%"]
      end

      it "handles strings with multibyte characters" do
        tokens([1,'@', 5,'%']).adjust_for_diff([[-1,"…"], [0,"éù"], [1,'èè']]) \
                              .validate.to_flat \
                              .must_equal [0,'@',6,"%"]
      end
    end

    describe "adjust_for_deletions" do
      it "adjusts for a simple deletion" do
        # 012345
        #    @
        # --
        #  @
        tokens([3,'@']).adjust_for_deletions([[0,2]]).validate.to_flat \
                       .must_equal [1,'@']
      end

      it "does not adjust token position at beginning of deletion" do
        # 01234
        #   @
        #   --
        #   @
        tokens([2,'@']).adjust_for_deletions([[2,4]]).validate.to_flat \
                       .must_equal [2,'@']
      end

      it "adjusts subsequent tokens" do
        # 012345678
        #      @  @
        # --  -
        #   @  @
        tokens([5,'@',8,'@']).adjust_for_deletions([[0,2],[4,5]]).validate.to_flat \
                             .must_equal [2,'@',5,'@']
      end

      it "adjusts for overlapping deletions (token falls inside the deletion)" do
        # 012345
        #  @
        # ----
        # @
        tokens([1,'@']).adjust_for_deletions([[0,4]]).validate.to_flat \
                       .must_equal [0,'@']
      end

      it "adjusts single token that falls inside the deletion by lesser offset, later one by full offset" do
        # 1234567890123
        #        @   @
        #      ----
        #      @ @
        tokens([8,'@',12,'@']).adjust_for_deletions([[6,10]]).validate.to_flat \
                             .must_equal [6,'@',8,'@']
      end

      it "adjusts multiple tokens that fall inside the same deletion by lesser offset, later one by full offset" do
        # 1234567890123
        #        @ @  @
        #      ------
        #      @@
        #      @
        tokens([8,'@',10,'@',13,'@']).adjust_for_deletions([[6,12]]).validate.to_flat \
                             .must_equal [6,'@',6,'@',7,'@']
      end

      it "accumulates adjustment offset of multiple deletions" do
        # 01234567890
        #           @
        #  ----   -
        #      @
        tokens(
          [10,'@']
        ).adjust_for_deletions(
          [[1,5], [8,9]]
        ).validate.to_flat.must_equal [5,'@']
      end
    end

    describe "adjust_for_insertions" do

      it "adjusts for a simple insertion" do
        # 012345
        #    @
        # ++
        #      @
        tokens([3,'@']).adjust_for_insertions([[0,2]]).validate.to_flat.must_equal [5,'@']
      end

      it "adjusts subsequent tokens" do
        # 0123456789
        #     @ @
        # ++
        #       @ @
        tokens([4,'@',6,'@']).adjust_for_insertions([[0,2]]).validate.to_flat \
                             .must_equal [6,'@',8,'@']
      end

      it "accumulates offset of multiple insertions" do
        # 01234567890
        #       @
        # ++ ++
        #           @
        tokens([6,'@']).adjust_for_insertions([[0,2],[3,5]]).validate.to_flat \
                             .must_equal [10,'@']
      end

      it "adjusts token that falls inside the insertion by full offset" do
        # 123456789012
        #        @
        #      ++++
        #            @
        tokens([8,'@']).adjust_for_insertions([[6,10]]).validate.to_flat \
                             .must_equal [12,'@']
      end

      it "adjusts touching tokens for affinity=:left" do
        # 01234
        #  @
        #  ++
        #  @
        tokens([1,'@']).adjust_for_insertions([[1,3]], :left).validate.to_flat \
                       .must_equal [1,'@']
      end

      it "adjusts touching tokens for affinity=:right" do
        # 01234
        #  @
        #  ++
        #    @
        tokens([1,'@']).adjust_for_insertions([[1,3]], :right).validate.to_flat \
                       .must_equal [3,'@']
      end

      it "considers prior insertions when deciding if a later insertion should adjust position" do
        # 0123456789012
        #       @
        #  ++++   ++++
        tokens(
          [6,'@']
        ).adjust_for_insertions(
          [[1,5], [8,12]]
        ).validate.to_flat.must_equal([14,'@'])
      end

      it "handles multiple tokens and insertions" do
        insertions = [
          [13, 14],
          [40, 41],
          [61, 62],
          [178, 179]
        ]
        tokens = [
          [0, :record_mark, "^^^ {: .rid #rid-C00A05B9}\n"],
          [1, :header_atx, "# "],
          [14, :record_mark, "\n^^^ {: .rid #rid-C00A05B6}\n"],
          [15, :header_atx, "### "],
          [15, :subtitle_mark, '@'],
          [40, :record_mark, "\n^^^ {: .rid #rid-C158A0B9}\n"],
          [41, :header_atx, "### "],
          [41, :subtitle_mark, '@'],
          [60, :record_mark, "\n^^^ {: .rid #rid-C158A1B9}\n"],
          [61, :subtitle_mark, '@'],
          [175, :ial_block, "\n{: .first_par .normal}\n"],
          [176, :subtitle_mark, '@'],
          [247, :subtitle_mark, '@'],
          [367, :subtitle_mark, '@'],
        ].map { |(pos, name, contents)| SuspendedToken.new(pos, name, contents) }
        xpect = [
          [0, :record_mark, "^^^ {: .rid #rid-C00A05B9}\n"],
          [1, :header_atx, "# "],
          [15, :record_mark, "\n^^^ {: .rid #rid-C00A05B6}\n"],
          [16, :header_atx, "### "],
          [16, :subtitle_mark, '@'],
          [42, :record_mark, "\n^^^ {: .rid #rid-C158A0B9}\n"],
          [43, :header_atx, "### "],
          [43, :subtitle_mark, '@'],
          [63, :record_mark, "\n^^^ {: .rid #rid-C158A1B9}\n"],
          [64, :subtitle_mark, '@'],
          [179, :ial_block, "\n{: .first_par .normal}\n"],
          [180, :subtitle_mark, '@'],
          [251, :subtitle_mark, '@'],
          [371, :subtitle_mark, '@'],
        ].map { |(pos, name, contents)| SuspendedToken.new(pos, name, contents) }
        AbsoluteSuspendedTokens.new(tokens)
          .validate
          .adjust_for_insertions(insertions)
          .must_equal(xpect)
      end

